import "./Content.css";

export default function Content({ data }) {
  // console.log(data);

  return (
    <div className="content-page">
      <ControlBar />
      <div className="content-box">
        {data.map((card) => (
          <Card cardData={card} />
        ))}
      </div>
    </div>
  );
}

async function animeData() {
  const res = await fetch(
    "https://api.jikan.moe/v4/anime?q=jujutsu kaisen&sfw"
  );
  const data = await res.json();
  console.log(data);
}

animeData();

function Card({ cardData }) {
  const { name, image, date, description } = cardData;
  // console.log(image);
  return (
    <div className="content-card">
      {/* <div className="content-card-face">
        <div className="card-face-img-box">
          <img
            className="card-face-img"
            src={"https://cdn.myanimelist.net/images/anime/1171/109222l.jpg"}
            alt="k"
          ></img>
        </div>
        <h2>jujutsu kaisen</h2>
      </div> */}

      <div className="content-card-back">
        <h2>{name}</h2>
        <br />
        <p>
          <strong>Release date:</strong>
          {date}
        </p>
        <br />
        <p>
          <strong>Description:</strong>
          <br />
          {description}
        </p>
      </div>
    </div>
  );
}

